(3,	'news',	'News',	'Indonectetus facilis',	'Nullamlacus dui ipsum conseque loborttis non euisque morbi penas dapibulum orna.',	'This is a W3C compliant free website template fromÂ <a href=\"http://www.os-templates.com/\" target=\"_blank\" rel=\"noopener\">OS Templates</a>. For full terms of use of this template please read ourÂ <a href=\"http://www.os-templates.com/template-terms\" target=\"_blank\" rel=\"noopener\">website template licence</a>. You can use and modify the template for both personal and commercial use. You must keep all copyright information and credit links in the template and associated files. For more HTML5 templates visitÂ <a href=\"http://www.os-templates.com/\" target=\"_blank\" rel=\"noopener\">free website templates</a>.',	14),
(4,	'news',	'News',	' New Tech Innovations Set to Transform Daily Life',	'Emerging technologies are revolutionizing industries, enhancing efficiency, and reshaping consumer experiences.',	'The rapid evolution of technology continues to drive major advancements across various sectors. From artificial intelligence streamlining business operations to renewable energy solutions reducing carbon footprints, the impact of innovation is evident. Experts predict that in the next decade, smart automation, augmented reality, and cutting-edge healthcare breakthroughs will redefine how people interact with the world. As industries embrace these changes, the potential for improved quality of life and economic growth remains promising.',	13),
(5,	'news',	'News',	' AI-Powered Assistants Are Becoming Smarter Than Ever',	'Advancements in artificial intelligence are making virtual assistants more intuitive and efficient.',	'Artificial intelligence is evolving rapidly, enabling virtual assistants to understand complex commands and provide human-like interactions. From scheduling tasks to managing emails, AI-powered tools are transforming the way individuals and businesses operate. As companies invest in AI research, the future holds even more sophisticated automation that enhances productivity and convenience.',	12),
(6,	'news',	'News',	'Electric Vehicles Gain Popularity Amid Rising Fuel Prices',	'The shift towards electric vehicles is accelerating as consumers seek cost-effective and sustainable alternatives.',	'With fuel prices surging and environmental concerns growing, electric vehicles (EVs) are seeing increased adoption. Automakers are introducing more affordable models with improved battery life, making EVs a viable option for the average consumer. Governments worldwide are also offering incentives to encourage the transition to clean energy transportation. Experts believe that within the next decade, EVs will dominate the automotive market.',	10),
(7,	'news',	'News',	'Space Tourism: A Dream Thatâ€™s Becoming Reality',	'Private companies are making space travel accessible to non-astronauts, paving the way for commercial space tourism.',	'What was once a sci-fi fantasy is now a reality, as companies launch successful missions sending civilians to space. With advancements in reusable rockets and lower launch costs, space tourism is becoming a booming industry. While ticket prices remain high, experts predict that costs will decline in the coming years, making space travel an exciting possibility for more people.',	11),
(8,	'news',	'News',	'Test News Data',	'Testing short description data Testing short description dataÂ Testing short description dataÂ Testing short description dataÂ Testing short description dataÂ ',	'Testing short description data Â Testing short description data Â  Testing short description data Testing short description data Testing short description data Testing short description data Testing short description data Testing short description dataÂ ',	11)
